class Graph
{
private:
    vector<int> recommend_ports;
    void debug();
public:
    int cnt_ip = 0;
    unordered_map<int, int> cnt_single;
    unordered_map<int, unordered_map<int,int> > cnt_both;
    Graph(vector<vector<int> *> &records);
    void update(vector<vector<int> *> &result);     // Update correlation graph using results of one batch
    int recommend(int index);                       // Get port recommendation
};

Graph::Graph(vector<vector<int> *> &records)
{
    update(records);
}

void Graph::update(vector<vector<int> *> &result)
{
    for(auto i = result.begin(); i != result.end(); ++i)
    {
        ++cnt_ip;
        for(auto j = (*i)->begin(); j != (*i)->end(); ++j)
           {
                ++cnt_single[*j];
                for(auto k = next(j, 1); k != (*i)->end(); ++k)
                {
                    ++cnt_both[*j][*k];
                    ++cnt_both[*k][*j];
                }
           }
    }
    auto tmp = new vector<pair<int, int> >;
    for(auto it = cnt_single.begin(); it != cnt_single.end(); ++it) tmp->push_back(make_pair(-it->second, it->first));
    sort(tmp->begin(), tmp->end());
    recommend_ports.clear();
    for(auto it = tmp->begin(); it != tmp->end(); ++it) recommend_ports.push_back(it->second);
    delete tmp;
#ifdef DEBUG_GRAPH
    for(auto it : cnt_single) printf("%d:%d ", it.first, it.second);
    printf("\n");
    for(auto it : cnt_both)
    {
        printf("%d: ", it.first);
        for(auto jt : it.second) printf("%d:%d ", jt.first, jt.second);
        printf("\n");
    }
#endif
};

int Graph::recommend(int index)
{
    if(index < recommend_ports.size()) return recommend_ports[index];
    index -= recommend_ports.size();
    if(index < CNT_TCP) return PORTS_TCP[index];
    return -1;
}

class dHeap
{
private:
    unordered_map<int, double> mp;
    priority_queue<pair<double, int> > pq1, pq2;
public:
    int top();
    void pop();
    double query(int k);
    void update(int k, double v);
};

int dHeap::top()
{
    while(!pq1.empty() && !pq2.empty())
    {
        pair<double, int> i1 = pq1.top(), i2 = pq2.top();
        if(i1 != i2) break;
        pq1.pop(), pq2.pop();
    }
    return pq1.empty() ? -1 : pq1.top().second;
}

void dHeap::pop()
{
    int tmp = top();
    if(tmp == -1) return;
    mp.erase(tmp);
    pq1.pop();
}

double dHeap::query(int k)
{
    auto it = mp.find(k);
    return it == mp.end() ? -1 : it->second;
}

void dHeap::update(int k, double v)
{
    auto it = mp.find(k);
    if(it != mp.end()) pq2.push(make_pair(it->second,k));
    mp[k] = v;
    pq1.push(make_pair(v,k));
}

class IP
{
private:
    Graph *graph;
    int recommend_index = 0;
    dHeap dh;
    unordered_set<int> used_ports;
    vector<int> opened_ports;
    double P(int port);                     // Get possibility of open port 
public:
    IP(Graph *p_graph);
    int nextPort();                         // Recommend next port
    void update(int port, bool result);     // Update correlation graph by scan result
};

IP::IP(Graph *p_graph)
{
    graph = p_graph;
}

double IP::P(int port)
{
    if(port < 0) return -1;
    double res = dh.query(port);
    if(res == -1)
    {
        auto it = graph->cnt_single.find(port);
        if(it == graph->cnt_single.end()) return -1;
        return 1.0 * it->second / graph->cnt_ip;
    }
    return res;
}

int IP::nextPort()
{
    while(recommend_index < 65536 && used_ports.find(graph->recommend(recommend_index)) != used_ports.end()) ++recommend_index;
    while(used_ports.find(dh.top()) != used_ports.end()) dh.pop();
    int resa = dh.top(), resb = graph->recommend(recommend_index);
    return P(resa) > P(resb) ? resa : resb;
}

void IP::update(int port, bool result)
{
    used_ports.insert(port);
    if(result)
    {
        opened_ports.push_back(port);
        for(auto it = graph->cnt_both[port].begin(); it != graph->cnt_both[port].end(); ++it)
        {
            double new_p = 1.0 * it->second / graph->cnt_single[port];
            if(new_p > P(it->first))
                dh.update(it->first, new_p);

        }
    }
}

void readFromFile(string &filename, vector<vector<int> *> &records)
{
    ifstream file(filename);
    string line;
    while(getline(file, line))
    {
        auto ports = new vector<int>;
        int tmp = 0;
        auto it = line.begin();
        while(*it != '[') ++it;
        for(; it!=line.end(); ++it)
        {
            if(isdigit(*it)) tmp = tmp * 10 + *it - '0';
            else if(tmp)
            {
                ports->push_back(tmp);
                tmp = 0;
            }
        }
        records.push_back(ports);
    }
}

mt19937 *rand_machine;
uniform_real_distribution<> uni_func(0.0, 1.0);
bool test_epsilon()
{
    double tmp = uni_func(*rand_machine);
#ifdef DEBUG
    if(tmp < epsilon) printf("EPSILON test POSITIVE: %lf < %lf\n", tmp, epsilon);
#endif
    return tmp < epsilon;
}

void recommend_ip(Graph *g, vector<int> *ports, vector<int> *scanned_open_ports)
{
    if(test_epsilon())
    {
        vector<vector<int> *>tmp;
        tmp.push_back(ports);
        g->update(tmp);
        scanned_open_ports->push_back(-1);
        return;
    }
#ifdef DEBUG
    printf("Running for a New IP...\n");
#endif
    auto ip = new IP(g);
    auto opened_ports = new unordered_set<int>(ports->begin(), ports->end());
    for(auto T = 0; T < recommend_round; ++T)
    {
        int port = ip->nextPort();
        if(opened_ports->find(port) != opened_ports->end())
        {
#ifdef DEBUG
            printf("Recommend OPEN  Port %d\n", port);
#endif
            ip->update(port, true);
            scanned_open_ports->push_back(port);
        }
        else
        {
#ifdef DEBUG
            printf("Recommend CLOSE Port %d\n", port);
#endif
            ip->update(port, false);
        }
    }
    delete ip;
    delete opened_ports;
}

string parse_args(int argc, char *argv[])
{
    if(argc == 2) return argv[1];
    else if(argc == 4)
    {
        recommend_round = atoi(argv[2]);
        epsilon = atof(argv[3]);
        return argv[1];
    }
    else
    {
        printf("Wrong Parameter. Expect 1 or 3, %d given.\n", argc - 1);
        printf("Usage:\n");
        printf("  %s <Log File to Read> # By default recommend round = 100, epsilon = 0.2\n", argv[0]);
        printf("  %s <Log File to Read> <Recommend Rounds> <Epsilon>\n", argv[0]);
        return "";
    }
}

void split_sets(vector<vector<int> *> *records,vector<vector<int> *> *train_set,vector<vector<int> *> *test_set)
{
    int train_set_size = max(1.0, records->size() * TRAIN_SET_PORTION);
    for(int i = 0; i < records->size(); ++i)
    {
        if(i < train_set_size) train_set->push_back((*records)[i]);
        else test_set->push_back((*records)[i]);
    }
}

void init_random()
{
    random_device rd;
    rand_machine = new mt19937(rd());
}

int main(int argc, char *argv[])
{
    init_random();

    string filename = parse_args(argc, argv);
    if(filename == "") return 1;
    cout << "File: " << filename << " ScanTime: " << recommend_round << " Epsilon: " << epsilon << endl;

    auto records = new vector<vector<int> *>;
    readFromFile(filename, *records);

    auto train_set = new vector<vector<int> *>;
    auto test_set = new vector<vector<int> *>;
    split_sets(records, train_set, test_set);
    delete records;
    
    auto g = new Graph(*train_set);
    auto batch_ports = new vector<vector<int> *>;
    int batch_size = max(1, int(test_set->size()) / TEST_SET_BATCHES), batch_counter = 0;
    int batch_cnt_open = 0, batch_cnt_open_scan = 0; // number of all open ports, number of scanned open ports
    for(auto it = test_set->begin(); it != test_set->end(); ++it)
    {
        auto ports_open_scan = new vector<int>;
        recommend_ip(g, *it, ports_open_scan);
        if(!ports_open_scan->empty() && (*ports_open_scan)[0] == -1) delete ports_open_scan; // Hit Epsilon Greedy
        else
        {
            batch_ports->push_back(ports_open_scan);
            batch_cnt_open += (*it)->size();
            batch_cnt_open_scan += ports_open_scan->size();
        }
        ++batch_counter;
        if(batch_counter == batch_size)
        {
            g->update(*batch_ports);

            printf("Open Rate: %d / %d = %lf ", batch_cnt_open_scan, batch_cnt_open, batch_cnt_open ? 1.0 * batch_cnt_open_scan / batch_cnt_open : 1.0);
            int batch_cnt_all = recommend_round * batch_ports->size();
            printf("Hit Rate: %d / %d = %lf\n", batch_cnt_open_scan, batch_cnt_all, batch_cnt_all ? 1.0 * batch_cnt_open_scan / batch_cnt_all : 1.0);

            for(auto it = batch_ports->begin(); it != batch_ports->end(); ++it) delete *it; // Recycle Memory
            batch_ports->clear();
            batch_counter = batch_cnt_open = batch_cnt_open_scan = 0;
        }
    }
    return 0;
}